import React from "react";
import { sidebarItems } from "../../data/data";
import { Link } from "react-router-dom";
import logo from "../../assets/bx_bxs-store-alt.svg";
import { Items, Item, Wrapper, Logo, Border, Border1 } from "./SidebarElements";

const Sidebar = () => {
  const style = {
    color: "#EA7C69",
  };


  return (
    <Items>
      <Logo>
        <img src={logo} alt="logo" />
      </Logo>
      {sidebarItems.data.map((item) => (
        <Link to={item.link} key={item.id}>
          <Item style={item.style}>
            <Wrapper style={item.wrapperStyle}>
              {/* <img style={style} src={item.icon} alt={item.link} /> */}
              <i class="fa fa-home" aria-hidden="true"></i>
              <Border style={item.style} />
              <Border1 style={item.style} />
            </Wrapper>
          </Item>
        </Link>
      ))}
    </Items>
  );
};

export default Sidebar;
